import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;

public class Problem438 {
	
    public static List<Integer> findAnagrams(String s, String p) {
        List<Integer> result = new ArrayList<>();
        
        HashMap<Character, Integer> sMap = new HashMap<>();
        HashMap<Character, Integer> pMap = new HashMap<>();
        for(Character c : p.toCharArray()) {
        	pMap.put(c, pMap.getOrDefault(c, 0) + 1);
        }
        
        int l = 0;
        int r = 0;
        int startIdx = 0;
        while(r < s.length()) {
        	if(r - l < p.length()) {
        		sMap.put(s.charAt(r), sMap.getOrDefault(s.charAt(r++), 0) + 1);
        	}else {
        		if(isAnagrams(sMap, pMap)) {
        			result.add(startIdx);
        		}
        	
        		if(sMap.get(s.charAt(l)) >= 2) {
        			sMap.put(s.charAt(l), sMap.get(s.charAt(l)) - 1);
        		}else {
        			sMap.remove(s.charAt(l));
        		}
        		
        		l++;
        		startIdx++;
        	}
        }
		if(isAnagrams(sMap, pMap)) {
			result.add(startIdx);
		}
	
        return result;
    }
    
    public static boolean isAnagrams(HashMap<Character, Integer> map1, HashMap<Character, Integer> map2){ 
    	if(map1.size() != map2.size()) {
    		return false;
    	}
    	else {
    		for(Character key : map1.keySet()) {
    			if(map2.get(key) == null || (int)map1.get(key) != (int)map2.get(key)) return false;
    		}
    	}
    	
    	return true;
    	
    }

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String s = "";
		String p = "";
		List<Integer> result = findAnagrams(s,p);
		for(int n : result) {
			System.out.print(n + " ");
		}
	}

}
